import updateClassName from"../helper/updateClassName.min.js";const LOADER=document.querySelector(".container-loadding"),queryAjax=async(t,a=null)=>{try{updateClassName("add",LOADER,null,"loadding-show");const e=await fetch(t,a);if(!e.ok)throw{status:e.status,statusText:e.statusText};const s=await e.json();if(s)return s}catch(t){let a=`Error ${t.status}: ${t.statusText||"Ocurrio un error"}`;console.error(a)}finally{updateClassName("remove",LOADER,null,"loadding-show")}};export default queryAjax;